import { Margin } from "@mui/icons-material";
import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <Link to="/" sx={{ Margin: "1" }}>
        Acceuil
      </Link>
      <Link to="/services">Services</Link>
      <Link to="/Profil/:id">Profil</Link>
    </nav>
  );
}

export default Navbar;
